definition:
A Hebrew patriarch (son of Isaac, and ancestor of the Jews),
   who in a vision saw a ladder reaching up to heaven (Gen. xxviii. 12);
   -- also called Israel.

The vertical side of any opening, as a door or fireplace;
   hence, less properly, any narrow vertical surface of wall, as the of a
   chimney-breast or of a pier, as distinguished from its face.

Pertaining to, or derived from, Japheth, one of the sons
   of Noah; as, Japhetic nations, the nations of Europe and Northern Asia;
   Japhetic languages.

To cause a short, tremulous motion of, to cause to tremble,
   as by a sudden shock or blow; to shake; to shock; as, to jar the earth;
   to jar one's faith.

A sort of light spear, to be thrown or cast by thew hand;
   anciently, a weapon of war used by horsemen and foot soldiers; now used
   chiefly in hunting the wild boar and other fierce game.

One of a pair of opposing parts which are movable towards or
   from each other, for grasping or crushing anything between them, as,
   the jaws of a vise, or the jaws of a stone-crushing machine.

Originally, one belonging to the tribe or kingdom of Judah;
   after the return from the Babylonish captivity, any member of the new
   state; a Hebrew; an Israelite.

To move by jogs or small shocks, like those of a slow trot;
   to move slowly, leisurely, or monotonously; -- usually with on,
   sometimes with over.

To be contiguous, close, or in contact; to come together;
   to unite; to mingle; to form a union; as, the hones of the skull join;
   two rivers join.

A joining of two things or parts so as to admit of motion;
   an articulation, whether movable or not; a hinge; as, the knee joint; a
   node or joint of a stem; a ball and socket joint. See Articulation.

Gay; merry; joyous; jolly; mirth-inspiring; hilarious;
   characterized by mirth or jollity; as, a jovial youth; a jovial
   company; a jovial poem.

The act of joining, or the state of being joined; union;
   combination; coalition; as, the junction of two armies or detachments;
   the junction of paths.

The place or point of union, meeting, or junction;
   specifically, the place where two or more lines of railway meet or
   cross.

A dense growth of brushwood, grasses, reeds, vines, etc.;
   an almost impenetrable thicket of trees, canes, and reedy vegetation,
   as in India, Africa, Australia, and Brazil.

Composed of juniors, whether younger or a lower standing;
   as, the junior class; of or pertaining to juniors or to a junior class.
   See Junior, n., 2.

Pertaining to a judge or to jurisprudence; acting in the
   distribution of justice; used in courts of law; according to law;
   legal; as, juridical law.

Conforming or conformable to rectitude or justice; not doing
   wrong to any; violating no right or obligation; upright; righteous;
   honest; true; -- said both of persons and things.

Not transgressing the requirement of truth and propriety;
   conformed to the truth of things, to reason, or to a proper standard;
   exact; normal; reasonable; regular; due; as, a just statement; a just
   inference.

Adjustment of type by spacing it so as to make it
   exactly fill a line, or of a cut so as to hold it in the right place;
   also, the leads, quads, etc., used for making such adjustment.
